import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import "../style.css";

export default function DivBox() {
  return (
    <div className="divDisplay">
      <FontAwesomeIcon icon="fa-brands fa-html5" />
      <FontAwesomeIcon icon="fa-brands fa-css3-alt" />
      <FontAwesomeIcon icon="fa-brands fa-js" />
      <FontAwesomeIcon icon="fa-brands fa-node" />
      <FontAwesomeIcon icon="fa-brands fa-react" />
      <FontAwesomeIcon icon="fa-brands fa-php" />
      <FontAwesomeIcon icon="fa-brands fa-square-git" />
      <FontAwesomeIcon icon="fa-brands fa-github" />
      <h3 className="iconNames">html</h3>
      <h3 className="iconNames">css</h3>
      <h3 className="iconNames">javascript</h3>
      <h3 className="iconNames">nodejs</h3>
      <h3 className="iconNames">react</h3>
      <h3 className="iconNames">php</h3>
      <h3 className="iconNames">git</h3>
      <h3 className="iconNames">github</h3>
    </div>
  );
}
